        RegistrationPlaceName: 'Quality Hotel Edvard Grieg',
        DescriptionInternal:
            'Som en del av Inkluderingsdugnaden arrangerer NAV Vestland seminaret Sammen f\u00e5r vi flere arbeid! \u00abHva er gode grep for inkludering p\u00e5 min arbeidsplass?\u00bb Seminaret vil gi deg innspill p\u00e5 dette temaet, b\u00e5de fra resultatbasert forskning og praktisk arbeid p\u00e5 feltet. Seminaret er gratis og \u00e5pent for alle virksomheter.',
        CatalogText: null,
        Description: '',
        FrontPageDescription:
            '<p>Som en del av Inkluderingsdugnaden arrangerer NAV Vestland seminaret Sammen f\u00e5r vi flere arbeid! \u00abHva er gode grep for inkludering p\u00e5 min arbeidsplass?\u00bb Seminaret vil gi deg innspill p\u00e5 dette temaet, b\u00e5de fra resultatbasert forskning og praktisk arbeid p\u00e5 feltet. Seminaret er gratis og \u00e5pent for alle virksomheter.</p>\r\n<p>Presentasjon av innlederne:</p>\r\n<p><strong>Kari Anne Holte</strong>: "En sentral akt\u00f8r for inkludering av unge inn i arbeidslivet er bedriftene. Men bedriftene har ogs\u00e5 krav om \u00e5 levere, noe som bedriftene kan oppleve som en barriere for \u00e5 bidra til \u00f8kt inkludering.<br />I sin presentasjon vil Holte vektlegge hva som karakteriserer bedrifter som er gode, og hvordan et handlingsrom for inkludering av unge kan utvikles."</p>\r\n<p><strong>Jan Martin Berge:</strong> "Hvordan lykkes med inkludering? Hva sier forskningen, hva trenger\u00a0 arbeidsgivere for \u00e5 lykkes? Hvilke behov har den ansatte?\u00a0 <br />Arbeidets betydning for et menneskes liv og psykiske helse<br />Hva er oppskriften p\u00e5 et inkluderende og godt arbeidsmilj\u00f8?<br />\u00a0"Psykolog-Berge" utvikler sjangeren "Akademisk stand-up". Han er kjent for \u00e5 holde motiverende og inspirerende foredrag om arbeidsglede og arbeidsmilj\u00f8. Han er spesialist i klinisk psykologi, arbeidspsykologi og kognitiv terapi, og har utdannelse fra Universitetet i Bergen med hovedpraksis fra San Francisco. Berge har lang erfaring med psykoterapi, undervisning, lederutvikling og veiledning. Til daglig har Jan-Martin ansvaret for psykologtjenestene hos Aker Care. \u00abPsykologBerge\u00bb har lenge interessert seg s\u00e6rlig for arbeidslivet og menneskene i organisasjoner og hvordan godt arbeidsmilj\u00f8 skapes. Jan-Martin var nominert til \u00ab\u00c5rets Taler\u00bb p\u00e5 Talerlisten i 2018."</p>\r\n<p><strong>Tor Ove Lussand</strong>, Direkt\u00f8r ABB Norge og Styreleder for Fontenehuset i Bergen. Som leder for 1000 ansatte i Norge er utvikling av medarbeidere, samt sikre et godt mangfold som utfordrer hverandre, viktig for \u00e5 lykkes fremover. Tor Ove Lussand forteller hvordan det \u00e5 ta et lokalt samfunnsansvar er noe bedrifter b\u00f8r oppleve som b\u00e5de forpliktelser og privilegier.</p>\r\n<p><strong>Heidi Wang</strong>, mulighetsagent i Noen ASHeidi er initiativtaker til KuPA-sertifiseringen, en ide som oppsto da hun selv var p\u00e5r\u00f8rende og \u00f8nsket \u00e5 hjelpe pasienter med \u00e5 beholde funksjoner og mestre ny livssituasjon med kronisk og progredierende sykdom. Arbeidstakerne fra NAV er rekruttert nettopp p\u00e5 grunn av kompetansen de har ervervet gjennom eget liv med sykdom og mestringsstrategiene de har skapt.</p>\r\n<p><strong>Ingrid Solheim</strong>, Administrerende Direkt\u00f8r i StS Ingrid Solheim, har hatt ulike stillinger i selskapet, og har jobbet b\u00e5de i prosjekt, administrasjon og ledelse. Hun er en engasjert dame med flere ulike tillitsverv i arbeidsgiverorganisasjoner. Ingrid er opptatt av at at StS skal ha et seri\u00f8st og ansvarlig arbeidsliv i Norge.</p>\r\n<p><strong>Kjetil R\u00f8ed</strong>, Direkt\u00f8r Quality hotell Edvard GriegNordic Choice Hotels har en kultur som omhandler inkludering i hotellkjeden, og jobber med litt annerledes onboarding. Dette er forankret fra toppledelse og ned til hver enkelt ansatt. Hvordan jobber Quality Hotel Edvard Grieg konkret med dette?</p>\r\n<p><strong>Harald Simonsen</strong>: Hva bidrar til \u00e5 skape en god kultur for inkludering? En samtale mellom Vinhuset AS, Laksev\u00e5g Maling Gulv AS og arbeidslivscoach Harald Simonsen. Begge bedriftene er, sammen med andre bedrifter i Bergensomr\u00e5det, medlemmer i rekrutteringsnettverk. M\u00e5let med nettverkene er \u00e5 \u00f8ke evnen til \u00e5 rekruttere inkluderende og bidra til kunnskaps- og erfaringsdeling mellom bedriftene, samt NAV som samarbeidsakt\u00f8r.</p>',
