            '<p>Etter p\u00e5melding vil en epost blir sendt til deg som bekreftelse\u00a0</p>',
        FrontPageDescription:
            '<div class="description">\r\n<p>Til</p>\r\n<p><strong>R\u00e5dmannen, ledere i </strong><strong>And\u00f8y kommune, \u00d8ksnes kommune, B\u00f8 kommune, Sortland kommune, Hadsel kommune, L\u00f8dingen kommune</strong></p>\r\n<p>Nav har nylig presentert en fersk omverdensanalyse som viser at samfunnet generelt st\u00e5r overfor flere utfordringer i framtida. Vi vet at andelen eldre \u00f8ker, folk trekkes mot byer og tettsteder, vi f\u00e5r flere personer med behov for bistand, samtidig som ressursene strammes inn. Samfunnsendringene vil utfordre b\u00e5de oss og kommunene i fylket.</p>\r\n<p>Nav hjelpemidler og tilrettelegging er i gang med et strategiarbeid for \u00e5 kunne m\u00f8te utfordringene, det handler om kompetanse, samarbeid og ikke minst utvikling av digitale tjenester og digitale verkt\u00f8y. Kommunene er v\u00e5r viktigste samarbeidspart og vi \u00f8nsker en dialog med dere om hvordan vi sammen kan m\u00f8te de utfordringene som kommer og samtidig levere gode tjenester til Nordlands befolkning.</p>\r\n<p>Vi hadde m\u00f8ter i noen regioner f\u00f8r ferien og tilbakemeldingene er positive, og derfor inviterer vi p\u00e5 nytt de kommunene som ikke hadde mulighet tidligere.</p>\r\n<p>\u00a0</p>\r\n<p><strong>Tema for dagen:</strong></p>\r\n<ul>\r\n<li>Presentasjon og dr\u00f8fting av statistikk og \u00f8konomi for hver enkelt kommune. Hva tenker dere at dette betyr i praksis for din kommune?</li>\r\n<li>Hva kan vi gj\u00f8re for \u00e5 underst\u00f8tte kommunene i framtida?</li>\r\n<li>Nye digitale l\u00f8sninger, hva kommer og hva er behovet?</li>\r\n<li>Kompetansebygging, hva er mest effektivt og hvilke behov finnes?</li>\r\n<li>Utvikle samarbeid p\u00e5 systemniv\u00e5</li>\r\n<li>Eventuelt, meld gjerne inn saker dere \u00f8nsker \u00e5 dr\u00f8fte</li>\r\n</ul>\r\n<p>\u00a0</p>\r\n<p><strong>Vi inviterer to ledere med beslutningsmyndighet fra hver kommune til strategim\u00f8te og\u00a0work-shop</strong></p>\r\n<p>Dette m\u00f8tet er ikke et fagm\u00f8te og det er ledere som er m\u00e5lgruppen. Det vil ikke v\u00e6re \u00e5pent for v\u00e5re fagkontakter denne gangen.</p>\r\n<p>Vi byr p\u00e5 kaffe/te og en enkel lunch.</p>\r\n<p>Velkommen!</p>\r\n<p>\u00a0</p>\r\n</div>\r\n<footer class="kurs-footer">\r\n<div class="kursliste-links-container"><a href="https://tjenester.nav.no/kurs/kursliste?valgtKursomrade=471">// Kurskatalog for Hjelpemidler og tilrettelegging</a></div>\r\n<div class="kursliste-links-container"><a href="https://tjenester.nav.no/kurs/kursliste">// Generell kurskatalog NAV</a></div>\r\n</footer>',
