        RegistrationPlaceName: 'NAV Hjelpemiddelsentral Oslo og Akershus',
        DescriptionInternal:
            'Workshop i Grid 3. Kurset skal gi hjelp, id\u00e9er og inspirasjon til videre arbeid med kommunikasjonsl\u00f8sningene. Kurset er for ansatte i f\u00f8rstelinjetjenesten, habiliteringstjenesten, fagsentre, p\u00e5r\u00f8rende, skole og barnehage.',
        CatalogText: '',
        Description: '<p>Du vil motta en e-post etter at du har meldt deg p\u00e5.</p>',
        FrontPageDescription:
            '<h3>M\u00e5l</h3>\r\n<p>Kurset skal gi hjelp, id\u00e9er og inspirasjon til videre arbeid med kommunikasjonsl\u00f8sningene.</p>\r\n<p>Forutsetter grunnkunnskaper i l\u00f8sning man \u00f8nsker \u00e5 jobbe med.</p>\r\n<p>Vi f\u00e5r assistanse fra Cognita med praktisk bruk og id\u00e9er.</p>\r\n<p>Kurset legger opp til egenaktivitet, s\u00e5 eget datautstyr m\u00e5 medbringes.</p>\r\n<p>Kurset er for ansatte i f\u00f8rstelinjetjenesten, habiliteringstjenesten, fagsentre, p\u00e5r\u00f8rende, skole og barnehage.</p>\r\n<p>\u00a0</p>\r\n<h3>Praktisk informasjon</h3>\r\n<p>Fremm\u00f8te senest kl. 9:15. Kurset begynner presist.</p>\r\n<p>\u00a0</p>\r\n<p>Kurset er gratis. Mat kan kj\u00f8pes i kantinen</p>\r\n<p>\u00a0</p>\r\n<h3>Parkering - VIKTIG!</h3>\r\n<p>Vi gj\u00f8r oppmerksom p\u00e5 at hjelpemiddelsentralen ikke har parkeringsmuligheter for kurs- og m\u00f8tedeltakere. Vi anbefaler derfor kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud (linje 5) til \u00d8kern T-banestasjon. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.</p>\r\n<p>Deltakere med bil m\u00e5 bruke betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8res.</p>',
