        FrontPageDescription:
            '<h3>M\u00e5l</h3>\r\n<p>Kurset vil gi en grunnleggende innf\u00f8ring i ASK verkt\u00f8yprogram Grid 3 og programmets funksjonalitet og muligheter. Kurset er rettet mot ansatte i 1.linjetjenesten, habiliteringstjenesten, fagsentre, p\u00e5r\u00f8rende, skole og barnehage.</p>\r\n<p>\u00a0</p>\r\n<h3>Innhold</h3>\r\n<p><br />Kurset legger opp til en del egenaktivitet. Ta med egen PC med ferdig installert programvare. Hjelpemiddelsentralen har noe l\u00e5neutstyr, gi beskjed via p\u00e5meldingen om dere trenger \u00e5 l\u00e5ne utstyr eller har behov for noe ekstra tilrettelegging.</p>\r\n<h3>\u00a0</h3>\r\n<h3>Praktisk informasjon</h3>\r\n<p><br />Fremm\u00f8te senest kl. 9:15. Kurset begynner presist.<br />Kurset er gratis. Mat kan kj\u00f8pes i kantinen, kun kort</p>\r\n<h3><br />Parkering - VIKTIG!</h3>\r\n<p><br />Vi gj\u00f8r oppmerksom p\u00e5 at hjelpemiddelsentralen ikke har parkeringsmuligheter for kurs- og m\u00f8tedeltakere. Vi anbefaler derfor kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud (linje 5) til \u00d8kern T-banestasjon. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.<br /><br />Deltakere med bil m\u00e5 bruke betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8res. torsdag 7. november 2019, kl 09:30</p>\r\n<p>\u00a0</p>',
