            '<h3 dir="LTR" align="LEFT">M\u00e5l</h3>\r\n<p dir="LTR" align="LEFT">Kurset gir en innf\u00f8ring i programmet og appen Snap + Core First som bygger p\u00e5 et systematisk rammeverk av kjerneord, tema, hurtigord, atferdsst\u00f8tte, ordlister og tastatur.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<h3 dir="LTR" align="LEFT">Innhold</h3>\r\n<p dir="LTR" align="LEFT">Tilpassing og redigering av oppsett.</p>\r\n<p dir="LTR" align="LEFT">Bakgrunn og m\u00e5lsetning for Snap + Core First.</p>\r\n<p dir="LTR" align="LEFT">Hvordan legge til rette for deltakelse og spr\u00e5kutvikling?</p>\r\n<p dir="LTR" align="LEFT">Synkronisering.</p>\r\n<p dir="LTR" align="LEFT">Tips og triks i Pathways-appen.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<p dir="LTR" align="LEFT">Ta med egen datamaskin (med oppdatert Windows 10), iPad eller Tobii-maskin med installert Snap + Core First. Dette m\u00e5 gj\u00f8res f\u00f8r oppm\u00f8te p\u00e5 kurs! For hjelp til nedlastning og installering, kontakt Tobii Dynavox teknisk support p\u00e5 telefon 55 55 10 60.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<p dir="LTR" align="LEFT">Snap+core first kan lastes ned gratis fra https://www.mytobiidynavox.com/Support/SnapCoreFirst</p>\r\n<p dir="LTR" align="LEFT">Pathways kan lastes ned gratis fra https://www.mytobiidynavox.com/Support/Pathways</p>\r\n<h3 dir="LTR" align="LEFT">\u00a0</h3>\r\n<h3 dir="LTR" align="LEFT">Praktisk informasjon</h3>\r\n<p dir="LTR" align="LEFT">Kurset er gratis. Lunsj kan kj\u00f8pes i kantinen p\u00e5 Hjelpemiddelsentralen. Kantinen tar ikke imot kontantbetaling, kun kort.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<h3 dir="LTR" align="LEFT">PARKERING - VIKTIG!</h3>\r\n<p dir="LTR" align="LEFT">Vi gj\u00f8r oppmerksom p\u00e5 at hjelpemiddelsentralen ikke har parkeringsmuligheter for kurs- og m\u00f8tedeltakere. Vi anbefaler derfor kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud (linje 5) til \u00d8kern T-banestasjon. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.</p>\r\n<p dir="LTR" align="LEFT">Deltakere med bil m\u00e5 bruke betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8res.</p>\r\n<p>\u00a0</p>',
