        FrontPageDescription:
            '<h3 dir="LTR" align="LEFT">M\u00e5l for kurset</h3>\r\n<p dir="LTR" align="LEFT">Brukerpass er et tilbud til personer som er erfarne brukere av hjelpemidler og som \u00f8nsker \u00e5 styre mer av prosessene rundt hjelpemiddelformidlingen selv. Dette orienteringsm\u00f8tet er ment for deg som \u00f8nsker brukerpass, eller deg som er erfaren brukerpassbruker og som m\u00e5 fornye brukerpasset, evt. som har behov for en oppfriskning.</p>\r\n<p dir="LTR" align="LEFT">Foresatte med erfaring med hjelpemidler kan administrere brukerpasset for sitt barn til barnet er 18 \u00e5r. N\u00e5r barnet fyller 18 \u00e5r m\u00e5 kopi av vergebeskikkelse leveres oss dersom du som verge fortsatt \u00f8nsker \u00e5 inneha brukerpass for bruker.</p>\r\n<p dir="LTR" align="LEFT">P\u00e5r\u00f8rende for brukere som er over 18 \u00e5r kan ellers ikke f\u00e5 brukerpass.</p>\r\n<p dir="LTR" align="LEFT">Store deler av m\u00f8tet vil inneb\u00e6re orientering og navigering p\u00e5 www.nav.no og v\u00e5r lokale hjemmeside. Dette vil bli vist p\u00e5 storskjerm. For best mulig utbytte av kurset anbefaler vi deltakerne \u00e5 ta med eget nettbrett eller b\u00e6rbar PC. Vi har noen ordin\u00e6re b\u00e6rbare PCer til utl\u00e5n.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<h3 dir="LTR" align="LEFT">Innhold</h3>\r\n<p dir="LTR" align="LEFT">- Kort om brukerpassordningen</p>\r\n<p dir="LTR" align="LEFT">- Behov for utredning</p>\r\n<p dir="LTR" align="LEFT">- Hvordan s\u00f8ke hjelpemidler</p>\r\n<p dir="LTR" align="LEFT">- Hvem gj\u00f8r hva ved behov for oppl\u00e6ring</p>\r\n<p dir="LTR" align="LEFT">- Behov for reparasjon og deler</p>\r\n<p dir="LTR" align="LEFT">- Hvordan bytte hjelpemidler</p>\r\n<p dir="LTR" align="LEFT">- Retur av hjelpemidler</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<h3 dir="LTR" align="LEFT">Praktisk informasjon</h3>\r\n<p dir="LTR" align="LEFT">Orienteringsm\u00f8tet vil v\u00e6re i samme bygg som teknisk verksted og lager (Kabelgaten 1). M\u00f8t opp i ekspedisjonen.</p>\r\n<p dir="LTR" align="LEFT">Lunsj kan kj\u00f8pes i kantinen p\u00e5 Hjelpemiddelsentralen. Kantinen tar ikke imot kontantbetaling, kun kort.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<h3 dir="LTR" align="LEFT">Parkering - VIKTIG!</h3>\r\n<p dir="LTR" align="LEFT">Vi anbefaler kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud til \u00d8kern T-banestasjon dersom de har mulighet til det. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.</p>\r\n<p dir="LTR" align="LEFT">\u00a0</p>\r\n<p dir="LTR" align="LEFT">Deltakere med bil kan finne informasjon om parkering p\u00e5 omr\u00e5det her. Det er ogs\u00e5 mulig \u00e5 st\u00e5 p\u00e5 betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8res.</p>\r\n<p>\u00a0</p>',
