        FrontPageDescription:
            '<p><strong>Power Academy</strong></p>\r\n<p>Snap+Core First legger til rette for spr\u00e5kutvikling gjennom bruk av ASK. Gir barn, unge og voksne som mangler funksjonelt talespr\u00e5k en strategi for deltakelse, utvikling og \u00f8kt lese-/skriveferdighet. Bruk en evidensbasert tiln\u00e6rming med n\u00f8ye utplukkede kjerneord som hjelper barnet \u00e5 bygge spr\u00e5k- og kommunikasjonsferdigheter.</p>\r\n<p><strong>Power Academy gir kompetanseheving.</strong></p>\r\n<p>Sammen med Cathrine Redi, logoped for Tobii Dynavox gir vi deg en teoretisk fordypning i strategien bak Core First og en praktisk gjennomgang av innholdet i ASK-appen. Du vil ogs\u00e5 f\u00e5 informasjonsverkt\u00f8y som er opprettet for \u00e5 st\u00f8tte brukerne og deres kommunikasjonspartnere.</p>\r\n<p><strong>Agenda:</strong></p>\r\n<p>- Spr\u00e5kutvikling</p>\r\n<p>- Alternativ og supplerende kommunikasjon (ASK)</p>\r\n<p>- Bakgrunn og m\u00e5lsetting for Snap+Core First</p>\r\n<p>- Deltakelse, Hurtigord og Tema</p>\r\n<p>- Hvorfor og hvordan kan vi legge til rette for brukers deltagelse?</p>\r\n<p>- Vi bruker appen og kommuniserer ved hjelp av Hurtigord og Tema.</p>\r\n<p>- Utvikling - St\u00f8tte for to m\u00f8ter \u00e5 utvide og utvikle sin ASK</p>\r\n<p>- Spr\u00e5klig bevissthet og forst\u00e5else</p>\r\n<p>- Kjerneord, Ordlister og Tastatur</p>\r\n<p>- Gi spesifikke beskrivelser ved \u00e5 bruke Kjerneord</p>\r\n<p>- Innf\u00f8ring i Pathways som er en metode for \u00e5 st\u00f8tte utvikling av kommunikasjonsferdigheter.</p>\r\n<p>\u00a0</p>\r\n<p>For mer informasjon:</p>\r\n<p><a href="https://www.tobiidynavox.no/snap/">https://www.tobiidynavox.no/snap/</a></p>\r\n<p><strong>OBS!! <br />P\u00c5MELDING TIL KURSET P\u00c5 DENNE LINKEN: <a href="https://tobiidynavoxnorge.eventbrite.com/">https://tobiidynavoxnorge.eventbrite.com/</a></strong></p>\r\n<p>\u00a0</p>\r\n<p>\u00a0<strong>Kurset er GRATIS.</strong></p>\r\n<p><strong>Ta med matpakke, vi serverer</strong> <strong>vann/te/kaffe.</strong></p>',
