        RegistrationDeadline: '2019-11-04 16:00:00',
        RegistrationPlaceName: 'NAV Hjelpemiddesentral Oslo og Akershus',
        DescriptionInternal:
            'Kurset er rettet mot synskontakter og ergoterapeuter som har behov for \u00e5 tolke \u00f8yemedisinske opplysninger. Dette er nyttig for \u00e5 vurdere om brukere kan ha krav p\u00e5 synshjelpemidler, i forbindelse med s\u00f8knader eller henvisninger til hjelpemiddelsentralen.',
        CatalogText: null,
        Description:
            '<p>Du vil motta en bekreftelse p\u00e5 e-post etter at du har meldt deg p\u00e5.</p>',
        FrontPageDescription:
            '<h3>M\u00e5l</h3>\r\n<p>Epikrise fra \u00f8yelege skal alltid vedlegges f\u00f8rste gangs henvisning eller s\u00f8knad i synssaker. Hjelpemiddelsentralen f\u00e5r ofte henvendelser med behov for \u00e5 tolke epikriser, og kurs har blitt etterspurt. N\u00e5 setter vi opp et kurs som vi h\u00e5per kan gj\u00f8re \u00f8yemedisinske epikriser lettere \u00e5 forst\u00e5.</p>\r\n<p>\u00a0</p>\r\n<h3>Innhold</h3>\r\n<p>Vi tar opp emner som:</p>\r\n<p>- Hva betyr egentlig en tallrekke som +0,25-1,5x95/+0,5-1,25x35 0,3++/0,3--?</p>\r\n<p>- Hva betyr forkortelser som OCT mac, ua, eb, RPE?</p>\r\n<p>- Hvilke deler av epikrisen er mest relevante \u00e5 se p\u00e5?</p>\r\n<p>- Hva slags briller b\u00f8r ha v\u00e6rt pr\u00f8vd ut f\u00f8r henvisning til utpr\u00f8ving av synshjelpemidler?</p>\r\n<p>Hvis du har epikriser du \u00f8nsker vi skal bruke som eksempler p\u00e5 kurset, kan du anonymisere dem og sende dem inn p\u00e5 forh\u00e5nd p\u00e5 epost til kursansvarlig.</p>\r\n<p>\u00a0</p>\r\n<h3>Praktisk informasjon</h3>\r\n<p>Registrering i resepsjonen fra kl. 08.45. Kurset starter presis kl. 09.00.</p>\r\n<p>\u00a0</p>\r\n<p>Lunsj kan kj\u00f8pes i kantinen p\u00e5 Hjelpemiddelsentralen. Kantinen tar ikke imot kontantbetaling, kun kort.</p>\r\n<p>\u00a0</p>\r\n<h3>Parkering - VIKTIG!</h3>\r\n<p>\u00a0</p>\r\n<p>Vi gj\u00f8r oppmerksom p\u00e5 at hjelpemiddelsentralen ikke har parkeringsmuligheter for kurs- og m\u00f8tedeltakere. Vi anbefaler derfor kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud til \u00d8kern T-banestasjon. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.</p>\r\n<p>Deltakere med bil m\u00e5 bruke betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8re<br /><br /></p>',
