            '<p>Workshop i Handi</p>\r\n<p>Hjelpemiddelsentral Oslo og Akershus arrangerer, i samarbeid med Abilia, workshop i ulike utgaver av Handi. Kurset vil gi oppl\u00e6ring i funksjoner og tilpasninger i Handi. Kurset passer for formidlere av kognitive hjelpemidler, brukere og st\u00f8ttepersoner.</p>\r\n<p>\u00a0</p>\r\n<p>Workshop i Handi skal gi \u00f8kt kunnskap om de ulike Handi-l\u00f8sningene Handi One, Handi 5 SW og Handikalender, med tilpasninger og bruk.</p>\r\n<p>\u00a0</p>\r\n<p>Program:</p>\r\n<p>09.00-09.15: Kort presentasjonsrunde</p>\r\n<p>09.15-10.00: Gjennomgang av Handi 5/Handikalender - liste/tids\u00f8yle/m\u00e5nedsvisning</p>\r\n<p>10.00-10.45: Forskjellene mellom Handi 5 og Handikalender - infomenyen , varslingsenter m.m</p>\r\n<p>10.45-11.00: Pause</p>\r\n<p>11.00-11.45: Felles demo - Fra Handi5 + Handikalender p\u00e5 iphone</p>\r\n<p>11.45-12.30: Gjennomgang av myAbilia</p>\r\n<p>12.30.13.15: LUNSJ</p>\r\n<p>13.15-15.00: Workshop/hands on\u00a0\u00a0</p>\r\n<p>\u00a0</p>\r\n<p>Kurset er gratis. Deltakere kan ta med egen Handi. Det vil ogs\u00e5 bli mulig \u00e5 l\u00e5ne Handi til de praktiske oppgavene.</p>\r\n<p>\u00a0</p>\r\n<p>Lunsj kan kj\u00f8pes i kantinen p\u00e5 Hjelpemiddelsentralen. Kantinen tar ikke imot kontantbetaling, kun kort.</p>\r\n<p>\u00a0</p>\r\n<p>Parkering - VIKTIG!</p>\r\n<p>Vi gj\u00f8r oppmerksom p\u00e5 at hjelpemiddelsentralen ikke har parkeringsmuligheter for kurs- og m\u00f8tedeltakere. Vi anbefaler derfor kurs- og m\u00f8tedeltakere \u00e5 benytte kollektivtilbud til \u00d8kern T-banestasjon. Det tar ca. 7 min \u00e5 g\u00e5 fra T-banen til hjelpemiddelsentralen. Til \u00d8kern g\u00e5r T-bane 4 og 5 (Vestli), og bussene 23, 24, 60, 67, 105, 107, 313, 345, 435, F3, N5, T2 og 153. Se www.ruter.no for mer informasjon.</p>\r\n<p>Deltakere med bil m\u00e5 bruke betalingsparkeringen i Haraldrudveien (forbi Kuben yrkesarena, bak Hotel 33). Betalingsparkeringen koster 10 kroner per time eller 100 kroner per d\u00f8gn (automaten tar kort). Det tar i underkant av 10 minutter \u00e5 g\u00e5 fra betalingsparkeringen til Kabelgaten 2 der de fleste kursene/minimessene gjennomf\u00f8res.</p>',
