        CatalogListMediaStorageID: null,
        RegistrationFromDateTime: '2019-10-01 00:00:00',
        RegistrationToDateTime: '2020-06-30 00:00:00',
        RegistrationDeadline: '2020-06-30 00:00:00',
        RegistrationPlaceName: 'Elektronisk kurs - lenke vert sendt etter p\u00e5melding.',
        DescriptionInternal:
            'P\u00e5melding til e-l\u00e6ringskurs for \u00e5 bli godkjent bestillar p\u00e5 bestillingsordninga.\r\nDatoene er fiktive.',
        CatalogText: null,
        Description:
            '<p>Du vil motta ei bekrefting p\u00e5 e-post etter at du har meldt deg p\u00e5.</p>\r\n<p>Du kan ogs\u00e5 melde deg av kurset om du ikkje \u00f8nskjer/kan delta.</p>\r\n<p>Hugs du m\u00e5 ha ein jobb-epostadresse for \u00e5 kunne ta kurset.</p>',
        FrontPageDescription:
            '<p>For \u00e5 f\u00e5 godkjenning som bestillar i Sogn og Fjordane:\u00a0 Kurset har ein fiktiv dato, denne betyr ikkje noko for n\u00e5r du tar e-l\u00e6ringsmodulen.</p>\r\n<p>Bestillingsordninga skal redusere leveringstid og administrasjon ved\u00a0 formidling av hjelpemiddel.</p>\r\n<p>For \u00e5 kunne bruke ordninga, m\u00e5 du ha godkjenning som bestillar. For \u00e5\u00a0 f\u00e5 godkjenning som bestillar i Hordaland, Rogaland, Sogn og Fjordane,\u00a0 Aust-Agder og Vest-Agder m\u00e5 du:</p>\r\n<p>1. Ha brukarpass eller vere kommunalt tilsett fagperson\u00a0 (ergoterapeut, fysioterapeut, sjukepleier, vernepleier, turnuskandidat\u00a0 i fysioterapi, helsefagarbeider).</p>\r\n<p>2. Ha gjennomf\u00f8rt og best\u00e5tt Grunnoppl\u00e6ring i hjelpemiddelformidling,\u00a0 som du finn p\u00e5\u00a0<a href="http://www.kunnskapsbanken.net/">Kunnskapsbanken.net</a>.</p>\r\n<p>3. Melde deg p\u00e5 denne e-l\u00e6ringa om Bestillingsordninga, og\u00a0 gjennomf\u00f8re e-l\u00e6ringa s\u00e5 snart du f\u00e5r lenke til sj\u00f8lve oppl\u00e6ringa.</p>\r\n<p><strong>Praktisk informasjon</strong></p>\r\n<p>N\u00e5r du har gjennomf\u00f8rt og best\u00e5tt kurset Grunnoppl\u00e6ring i\u00a0 hjelpemiddelformidling (sj\u00e5 over) melder du deg p\u00e5 dette kurset.</p>\r\n<p>Det er viktig at du oppgjer e-postadressa du brukar i jobbsamanheng\u00a0 n\u00e5r du melder deg p\u00e5. Vi sender ikkje lenke til private e-postadresser.</p>\r\n<p>I l\u00f8pet av\u00a0ei veke etter at du har meldt deg p\u00e5, f\u00e5r du\u00a0tilsendt\u00a0 lenke til sj\u00f8lve oppl\u00e6ringa.\u00a0Lenka\u00a0kan berre nyttast av den som melder\u00a0 seg p\u00e5, og skal ikkje sendast vidare til andre.</p>\r\n<p>Inntak p\u00e5 e-l\u00e6ringskurset skjer ein gong kvar veke.</p>\r\n<p>\u00a0</p>',
