        RegistrationID: 161,
        Title: 'Det gode liv p\u00e5 jobb',
        RegistrationUrl: 'https://nav.pameldingssystem.no/det-gode-liv-pa-jobb-1',
        RegistrationImageMediaStorageID: 45,
        FrontImageMediaStorageID: 44,
        CatalogListMediaStorageID: null,
        RegistrationFromDateTime: '2019-11-28 09:00:00',
        RegistrationToDateTime: '2019-11-28 15:30:00',
        RegistrationDeadline: '2019-11-14 13:00:00',
        RegistrationPlaceName: 'Clarion Hotel The Edge, Troms\u00f8',
        DescriptionInternal:
            'Det gode liv p\u00e5 jobb - en konferanse om ledelse og arbeidsmilj\u00f8',
        CatalogText: null,
        Description:
            '<p>Her kan du melde deg p\u00e5 konferansen. Du kan ogs\u00e5 melde p\u00e5 flere deltakere enn deg selv.</p>\r\n<p>Du vil f\u00e5 en e-post som bekreftelse p\u00e5 p\u00e5meldingen.</p>',
        FrontPageDescription:
            '<h3>Innhold</h3>\r\n<p>Det gode liv p\u00e5 jobb er en konferanse om ledelse og arbeidsmilj\u00f8.<br />Tema for \u00e5rets konferanse er: Utvikling og lagbygging.<br />Kom og bli inspirert!</p>\r\n<p>\u00a0</p>\r\n<h3>Foredragsholdere</h3>\r\n<h4>\u00a0<br />Ole B. S\u00e6verud</h4>\r\n<p>er politimester i Troms. Ole er Troms\u00f8-gutt, jurist og har ogs\u00e5 jobbet som statsadvokat og\u00a0i politidirektoratet.\u00a0Han har som leder st\u00e5tt i sentralt i oppbyggingen av et nytt politidistrikt, og arbeidshverdagen er preget av viktige endringsprosesser - blant annet innen digitalisering av tjenester.\u00a0</p>\r\n<p>\u00a0</p>\r\n<h4>Ole Martin \u00c5rst og Glenn Solberg</h4>\r\n<p>er pensjonerte idrettsut\u00f8vere p\u00e5 h\u00f8yt niv\u00e5 som vet mye om lagbygging. Hva er viktig for \u00e5 bygge det gode arbeidslaget, og hva kan vi l\u00e6re om lagbygging av idretten? Ganske mye, viser det seg!</p>\r\n<p>\u00a0</p>\r\n<h4>Samuel Massie</h4>\r\n<p>er i dag kjent for de fleste. Fra \u00e5 droppe ut av skolen, via Folkeh\u00f8gskole i Malangen, til medieoppmerksomhet da Berserk forliste, reiser, TV-jobber og n\u00e5 ogs\u00e5 forsker ved Universitetet i Bergen. Samuel snudde om p\u00e5 livet sitt, og \u00f8nsker \u00e5 inspirere mennesker til \u00e5 ta et oppgj\u00f8r med seg selv, settev seg m\u00e5l og gjennomf\u00f8re dem. Hold fast! er et gripende foredrag om mestring, m\u00e5lbevissthet og menneskers evne til forandring.</p>\r\n<h4>\u00a0<br />Halvor Haukerud/Motarbeider</h4>\r\n<p>er d\u00e5rlig leder i motarbeider.no og har siden etableringen av selskapet jobbet mot nedleggelse. Det har g\u00e5tt veldig d\u00e5rlig, blant annet fordi vi og andre gjerne inviterer dem tilbake. De gjorde suksess p\u00e5 v\u00e5r konferanse i 2015, og n\u00e5 kommer de heldigvis tilbake med skr\u00e5blikk p\u00e5 organisasjoner og arbeidsliv, og p\u00e5 hvordan endringsarbeid er blitt det konstante i arbeidshverdagen. Halvor f\u00e5r oss til \u00e5 reflektere og til \u00e5 le - ogs\u00e5 av oss selv. Med foredraget "Det er litt mye akkurat n\u00e5" f\u00e5r vi essensen i motarbeider.no, ogs\u00e5 anvendt p\u00e5\u00a0endring, omstilling, utvikling - kall det hva du vil - det er uansett litt mye akkurat n\u00e5.</p>\r\n<p>\u00a0</p>\r\n<h3>Varighet</h3>\r\n<p>Kl. 10:30 - 15:30.</p>\r\n<p>Registrering starter kl. 09:00.</p>\r\n<p>\u00a0</p>\r\n<h3>Praktiske opplysninger</h3>\r\n<p>Deltakeravgift p\u00e5 kr. 750, fakturagebyr p\u00e5 kr. 50 kommer i tillegg.<br />Deltakeravgift inkluderer kaffe/te, lunsj og pausebevertning.</p>\r\n<p>P\u00e5meldingsfrist 14.11.19. Bindende p\u00e5melding.</p>\r\n<p>\u00a0\u00a0</p>\r\n<h3>Program</h3>\r\n<p>Kl. 09:00 - 10:30\u00a0\u00a0 Registrering</p>\r\n<p>Kl. 10:30 - 10:40\u00a0\u00a0 Velkommen, v/ Grete Kristoffersen,\u00a0fylkesdirekt\u00f8r NAV Troms og Finnmark</p>\r\n<p>Kl. 10:40 - 11:10\u00a0\u00a0 "Hva st\u00e5r p\u00e5 spill?", v/ Ole B. S\u00e6verud,\u00a0Politimester i Troms</p>\r\n<p>Kl. 11:10 - 12:00\u00a0\u00a0 "Lagbygging", v/ Ole Martin \u00c5rst og Glenn Solberg</p>\r\n<p>Kl. 12:00 - 12:15\u00a0\u00a0 Pause</p>\r\n<p>Kl. 12:15 - 13:00\u00a0\u00a0 "Hold fast", v/ Samuel Massie</p>\r\n<p>Kl. 13:00 - 14:00\u00a0\u00a0 Lunsj</p>\r\n<p>Kl. 14:00 - 15:30\u00a0\u00a0 "Det er litt mye akkurat n\u00e5", v/ Halvor Haukerud,\u00a0D\u00e5rlig leder Motarbeider</p>\r\n<p>Kl. 15:30\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0 \u00a0\u00a0\u00a0 \u00a0 Vel hjem!</p>',
